import React from "react";

function menu_left() {
  return (
    <>
      <div id="layoutSidenav_nav">

      <li>
          <Link to="/About">About</Link>
        </li>
        <li>
          <Link to="/Product">Product</Link>
        </li>
      </div>
    </>
  );
}

export default menu_left;
